import React from "react";
//
import Link from "next/link";
//
import { NavLink } from "../../types";

interface AllLinks {
  links: NavLink[];
}

const NavigationLinks: React.FC<AllLinks> = ({ links }: AllLinks) => (
  <React.Fragment>
    {links.map((item) => (
      <li>{item.content}</li>
    ))}
    ;
  </React.Fragment>
);

export default NavigationLinks;
